var tipuesearch = {"pages": [{'title': 'About', 'text': '個人網站: https://s40723226.github.io/wcm2022/content/index.html \n 個人倉儲: https://github.com/s40723226/wcm2022 \n', 'tags': '', 'url': 'About.html'}, {'title': 'Progress', 'text': '', 'tags': '', 'url': 'Progress.html'}, {'title': 'week1-12', 'text': 'week1 \n 創建wcm2022倉儲，並建立網站， 設定SSH。 \n week2 \n 使用wink練習。 \n week7 \n 架設nginx服務器設定。 \n \n', 'tags': '', 'url': 'week1-12.html'}, {'title': 'week13', 'text': '\n \n \n', 'tags': '', 'url': 'week13.html'}, {'title': 'week14', 'text': '\n \n \n \n \n \n \n \n  Cango 程式庫  \n \n \n \n \n \n \n \n \n  for Konva 程式庫  \n \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  ######################  editor1 開始 ######################  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div 作為切入位置  \n  這裡的畫布 id 為 brython_div  \n \n  graphics-column is for ggame  \n \n  ######################  editor1 結束 ######################  \n  以下可以開始利用 editor1 的設定編寫對應 Brython 程式  \n \n  以上為內建程式, 頁面可透過 ?src=gist_url 執行  \n  add 1 to 100 開始  \n \n \n', 'tags': '', 'url': 'week14.html'}, {'title': 'midterm', 'text': '\n \n 配合 Wink 檔案將 js 檔案設定如下 \n \n  接下來將 mp4 檔案從 downloads 目錄取出  \n \n \n \n', 'tags': '', 'url': 'midterm.html'}, {'title': 'Tetris', 'text': '/downloads/Tetris 線上遊戲加入計分系統報告.pdf \n /downloads/Tetris 線上遊戲加入計分系統報告2.pdf \n \n \n  for ggame  \n \n \n \n \n \n \n \n \n  Cango 程式庫  \n \n \n \n \n \n \n \n \n  for Konva 程式庫  \n \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  ######################  editor1 開始 ######################  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div 作為切入位置  \n  這裡的畫布 id 為 brython_div  \n \n  graphics-column is for ggame  \n \n  ######################  editor1 結束 ######################  \n  以下可以開始利用 editor1 的設定編寫對應 Brython 程式  \n \n  以上為內建程式, 頁面可透過 ?src=gist_url 執行  \n  add 1 to 100 開始  \n \n \n', 'tags': '', 'url': 'Tetris.html'}, {'title': 'Final', 'text': '/downloads/網路內容管理期末報告.pdf \n', 'tags': '', 'url': 'Final.html'}, {'title': 'W17', 'text': '心得: \n 一開始的建倉儲到新的ssh是與之前不一樣的，後來也學習到如何架設nginx服務器，而wink的影片製作也是第一次接觸這個程式，到後來的俄羅斯方塊的程式導入與設定是沒嘗試過的，而且能看懂一下內容，是覺得還蠻酷的。 \n 旋轉為R 下降為D 移動為左右方向鍵 \n \n \n 在 div 外圍加入細黑線標定影片範圍, 且利用 padding 留下 top right buttom left 各 10px 間隔 \n \n \n \n <div class="winkVideoContainerClass"><video width="1008" height="630" autoplay="autoplay" class="winkVideoClass" controls="controls" data-dirname="./../cmsimde/static" data-varname="winkVideoData" muted="true">\n<source src="./../downloads/W17.mp4" type="video/mp4" /></video>   蓋掉由 Wink Javascript 與 css 所建立的影片控制項目   <div class="winkVideoOverlayClass"></div>\n<div class="winkVideoControlBarClass"><button class="winkVideoControlBarPlayButtonClass"></button> <button class="winkVideoControlBarPauseButtonClass"></button>\n<div class="winkVideoControlBarProgressLeftClass"></div>\n<div class="winkVideoControlBarProgressEmptyMiddleClass"></div>\n<div class="winkVideoControlBarProgressRightClass"></div>\n<div class="winkVideoControlBarProgressFilledMiddleClass"></div>\n<div class="winkVideoControlBarProgressThumbClass"></div>\n</div>\n<div class="winkVideoPlayOverlayClass"></div> \n \n \n \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W17.html'}]};